import React, { Component } from 'react';

export default class SignInForm extends Component{
	render(){
		return(
			<div className="container">
				<div className="row">
					<div className="col-sm-4">
					<form>
					    <div className="form-group d-flex">
					      <label className="col-sm-3">Email:</label>
					      <input type="email" className="form-control col-sm-9" id="email" placeholder="Enter email" name="email" />
					    </div>
					    <div className="form-group d-flex">
					      <label className="col-sm-3">Password:</label>
					      <input type="password" className="form-control col-sm-9" id="pwd" placeholder="Enter password" name="pswd" />
					    </div>
					    <button type="submit" className="btn btn-primary">Submit</button>
					  </form>
					</div>
				</div>
			</div>
		);
	}
}
